import "./upload.css";
import React, {useState} from "react";
import axios from "axios";
import loginForm from "./LoginForm";
import UploadFile from "./UploadFile";

const SuccessPage = (props) => {
    const [images, setImages] = useState([]);


    async function clickev(event) {
        event.preventDefault();
        const auth = JSON.parse(localStorage.getItem("user"));
        const response = await axios.get('http://localhost:8080/api/v1/registration/add', {
                auth: {
                    username: auth.user,
                    password: auth.pass
                }
            }
        );
        const images = response.data;
        setImages(images);
    }
    const staticUrl = "http://localhost:8080/img/";
    const listItems = images.map((image) =>
        <img src={staticUrl.concat(image.url)}/>
    );

    return (
        <UploadFile/>
    );
};

export default SuccessPage;
